import React from 'react'
import { useDispatch } from 'react-redux'
import { logout } from '../services/authAPI';
import { useNavigate } from 'react-router-dom';

const Home = () => {
  const dispatch=useDispatch();
  const navigate=useNavigate();
  return (
    <div className='h-full w-full flex justify-center items-center' >
       <nav className='w-full h-full top-0 text-center text-yellow-500 font-bold text-xl ' >
       <button className='w-[100px] h-[50px] bg-red-500' onClick={()=>{dispatch(logout(navigate))}}>Logout</button>
       </nav>
       <div className='w-full  text-red-800 font-bold text-xl'>
          Home
       </div>
    </div>
  )
}

export default Home
